def print_zipcode(n):
    i = 0
    print("zipcode_list = [", end="")

    for a in "ABCDEFGHIJKLMNOPQRSTUVWXYZ":
        for b in "0123456789":
            for c in "ABCDEFGHIJKLMNOPQRSTUVWXYZ":
                for d in "0123456789":
                    for e in "ABCDEFGHIJKLMNOPQRSTUVWXYZ":
                        for f in "0123456789":
                            print(f"\"{a}{b}{c} {d}{e}{f}\", ", end="")
                            i += 1
                            if i%10 == 0:
                                if i >= n:
                                    print("\b\b]")
                                    return
                                else:
                                    print("\n                ", end="")

